/**
 * @param {number} n
 * @return {number}
 */
var stringCount = function(n) {
    const mod = 1e9 + 7;

    const factorial = (n) => {
        let result = 1;
        for (let i = 2; i <= n; i++) {
            result = (result * i) % mod;
        }
        return result;
    };

    const powMod = (a, b) => {
        let result = 1;
        a = a % mod;
        while (b > 0) {
            if (b & 1) result = (result * a) % mod;
            b = b >> 1;
            a = (a * a) % mod;
        }
        return result;
    };

    if (n < 4) return 0;
    if (n == 4) return 12;

    let total = factorial(n);
    let excludeLeet = (((factorial(n - 4) * powMod(25, n - 4)) % mod) * 24) % mod; // Exclude "leet" exactly once
    excludeLeet = (excludeLeet * 4) % mod; // Choose one of the four characters to exclude
    total = (total - excludeLeet + mod) % mod; // Subtract the cases where "leet" is not included

    return total;
};
